import Design from "./3d-cube.svg";
import Analysis from "./analysis.svg";
import Development from "./internet.svg";

const Images = [
  {
    id: "Design",
    src: Design,
    description: ["Photoshop","After Effects", "Illustrator", "Cinema 4d","Figma"],
    name: "Design"
  },
  {
    id: "Development",
    src: Development,
    description: ["Python","After Effects", "Illustrator", "Cinema 4d","Figma"],
    name: "Development"
  },
  {
    id: "Analysis",
    src: Analysis,
    description: ["Python","After Effects", "Illustrator", "Cinema 4d","Figma"],
    name: "Analysis"
  }
];

export default Images;
